>大概看了下没啥问题。关于对外，我总结下来，大部分人的偏见就是认为所有的中文编程都是易语言那个套马甲的套路，觉得这种翻译工作（中文->英文代码->字节码/二进制机器码）没有必要。我觉得对外的工作方面，可以考虑让他们见识见识更实用，更多样化的中文编程（比如 #72 里面提到的那个zhihu的中文SQL的例子，我觉得就很有代表性，且具有一定的说服力）。
